import React, { Component } from 'react'
import { Grid, Container, Typography } from "@material-ui/core"

export class Member extends Component {
    constructor(name, photo, position) {
        super(name);
        this.name = name
        this.photo = photo
        this.position = position
        this.member = name
        this.state = {
          count: 0
        };
      }

      render() {
        return (     
            <Grid item lg={3} md={4}>
                <div className='member'>
                    <a>
                        <img className='memberPhoto' src={`${this.member.photo}`} alt='user' />
                        <div className='memberInfo'>
                            <h3 className='memberName'>{this.name}</h3>
                            <small className='memberPosition'>{this.member.position}</small>
                            {/* <p className='memberDesc'>{member.desc}</p> */}
                            <p>You clicked {this.state.count} times, member = {this.member.name}</p>
                            <button onClick={() => this.setState({ count: this.state.count + 1 })}>
                                Click me
                            </button>
                        </div>
                    </a>
                </div>
            </Grid>

        )}
                
}

export default Member
